#include <iostream>
#include <vector>
#include <set>
#include <unordered_map>

using namespace std;

void mySwap (int &a, int &b)
{
    int t = a;
    a = b;
    b = t;
}

vector<int> sortXYZ(int x, int y, int z)
{
    vector<int> ans;

    if (y < x)
        mySwap(x, y);
 
    if (z < y)
    {
        mySwap(y, z);
        if (y < x)
            mySwap(y, x);
    }

    ans.push_back(x);
    ans.push_back(y);
    ans.push_back(z);
    
    return ans;
}

